function myDas(){
  content = $('#midy').text()
  if(content.length==0){
    document.getElementById("blnk").innerHTML = `<code>the contents of the API documentation are not available. <a href="../../~">Back home</a></code>`;
    $('.badge').hide();
  } else {
    setTimeout(function(){
      $('.badge').hide();
      $('.showdata').show();
    },1000)
  }
    
}
